import React from "react";

function Jumbotron({ children }) {
  return (
    <Row>
      <Col s={10} className="offset-s1">
        <Card title='Google Books Search'>
          Search For and Save Books of Interest!
            </Card>
      </Col>
    </Row>
  );
}

export default Jumbotron;
